    let uid=props.userid
    let pass=props.password
    let data
    const options = {
        method : 'POST',
        headers : {
            'Content-Type' : 'application/json'
        },
        body : JSON.stringify({uid,pass})
    }
    
    fetch('http://127.0.0.1:5000/api/login',options)  // API endpoint of your Flask server
        .then(response => response.json())
        .then(data => {
        console.log("data ",data)
        })
        .catch(error => {
        console.error('Error:', error);
    });

    return(
        <div>
            {data}
        </div>
    )

}

